import React from 'react'
import './Header.css'
function Header() {
    return (
        <div className='navbar'>
        
        <img className='avatar' src="https://i.pinimg.com/originals/10/12/c0/1012c06c7e1b0f8f5e60611992785e5a.png" alt="Avatar" />

    </div>
    )
}

export default Header
